import React from 'react'
import '../Wall/Wall.scss'

function Wall({img}) {
    return (
        <>
            {/* <div className="col"> */}
                <img className='mx-auto d-block' src={img} alt="" />
            {/* </div> */}
        </>
    )
}

export default Wall
